import React from 'react';
import FilterableHoursReports from './components/filterable-hours-reports/filterable-hours-report.comp';

const HoursPage = () => {

    let reportsList = [
        {
            name: 'Juan',
            teacherReport: [
                {
                    group: "UNAL 1",
                    date: "02/03/2021",
                    numHours: 2, 
                }
            ]
        }
    ];

return (
    <FilterableHoursReports reportsList = {reportsList}/>

);
}

export default HoursPage;
